(function() {
  $('.navItem:eq(0)').toggleClass('active');

  //Make Refresh Button Spin
  $('i.fa-refresh').click(function(ev) {
    $('i.fa-refresh').toggleClass('fa-spin');
    return setTimeout(function() {
      return $('i.fa-refresh').toggleClass('fa-spin');
    }, 2000);
  });

  $('.navItem').click(function(ev) {
    var i;
    $('#player').prop('src', "https://www.youtube.com/watch?v=2GBzYu59YLQ");
    $('.navItem').removeClass('active');
    $(this).toggleClass('active');
    i = $(this).index();
    i = i * -100;
    i = i + "%";
    return $('#mainContentSlider').css('left', i);
  });

  $('span.video').click(function(ev) {
    var src;
    src = $(this).prop('id');
    $('#iframeLoader').toggleClass('activeIframe');
    $('span.video').css('pointer-events', 'none');
    return setTimeout(function() {
      $('#iframeLoader').toggleClass('activeIframe');
      $('span.video').css('pointer-events', 'initial');
      return $('#player').prop('src', src);
    }, 1500);
  });

  $('.galleryImage').click(function(ev) {
    return $(this).toggleClass('popoutImage');
  });

  $('#pictures, #blog').jScrollPane();

}).call(this);

